import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { LayoutArchitectComponent } from './layout-architect/layout-architect.component';
import { LayoutProgrammerComponent } from './layout-programmer/layout-programmer.component';


@NgModule({
  declarations: [
    LayoutArchitectComponent,
    LayoutProgrammerComponent
  ],
  imports: [
    CommonModule,
  ]
})
export class LayoutsModule { }
